import React from 'react';

import './Video.scss';

export default function Video(props) {

  return (
    <div className="Video">

      <video poster={props.still} controls>
        <source src={props.video}/>
      </video>

      <iframe src={"https://www.youtube.com/embed/" + props.video} width="640" height="360"  frameborder="0" allowfullscreen></iframe>


    </div>
  )
}
